--
-- Definition of procedure `AVIZARIsp_SelectByIdSocietate`
--

DROP PROCEDURE IF EXISTS `AVIZARIsp_SelectByIdSocietate`;

DELIMITER $$

/*!50003 SET @TEMP_SQL_MODE=@@SQL_MODE, SQL_MODE='STRICT_TRANS_TABLES,NO_AUTO_CREATE_USER,NO_ENGINE_SUBSTITUTION' */ $$
CREATE DEFINER=`root`@`localhost` PROCEDURE `AVIZARIsp_SelectByIdSocietate`(
        _AUTHENTICATED_USER_ID INT,
        _ID_SOCIETATE INT)
BEGIN
        SELECT D.*,
                ASIGC.DENUMIRE ASIGURAT_CASCO,
                ASIGR.DENUMIRE ASIGURAT_RCA,
                AC.NR_AUTO NR_AUTO_CASCO,
                AR.NR_AUTO NR_AUTO_RCA,
                SC.DENUMIRE ASIGURATOR_CASCO,
                SR.DENUMIRE ASIGURATOR_RCA,
                I.DENUMIRE INTERVENIENT,
                TD.DENUMIRE TIP_DOSAR
        FROM DOSARE D
        INNER JOIN DOSARE_STADII DS ON D.ID=DS.ID_DOSARE
        INNER JOIN STADII S ON DS.ID_STADIU=S.ID
        LEFT JOIN ASIGURATI ASIGC ON D.ID_ASIGURAT_CASCO=ASIGC.ID
        LEFT JOIN ASIGURATI ASIGR ON D.ID_ASIGURAT_RCA=ASIGR.ID
        LEFT JOIN AUTO AC ON D.ID_AUTO_CASCO=AC.ID
        LEFT JOIN AUTO AR ON D.ID_AUTO_RCA=AR.ID
        LEFT JOIN SOCIETATI_ASIGURARE SC ON D.ID_SOCIETATE_CASCO=SC.ID
        LEFT JOIN SOCIETATI_ASIGURARE SR ON D.ID_SOCIETATE_RCA=SR.ID
        LEFT JOIN INTERVENIENTI I ON D.ID_INTERVENIENT=I.ID
        LEFT JOIN TIP_DOSARE TD ON D.ID_TIP_DOSAR=TD.ID
        WHERE ID_SOCIETATE_RCA = _ID_SOCIETATE AND
        LOWER(S.DENUMIRE) = 'avizare';

END $$
/*!50003 SET SESSION SQL_MODE=@TEMP_SQL_MODE */  $$

DELIMITER ;

