--
-- Definition of procedure `DOCUMENTE_SCANATEsp_GetByIdDosar`
--

DROP PROCEDURE IF EXISTS `DOCUMENTE_SCANATEsp_GetByIdDosar`;

DELIMITER $$

/*!50003 SET @TEMP_SQL_MODE=@@SQL_MODE, SQL_MODE='STRICT_TRANS_TABLES,NO_AUTO_CREATE_USER,NO_ENGINE_SUBSTITUTION' */ $$
CREATE DEFINER=`root`@`localhost` PROCEDURE `DOCUMENTE_SCANATEsp_GetByIdDosar`(
        _AUTHENTICATED_USER_ID INT,
        _ID_DOSAR INT)
BEGIN
        DECLARE _DEFAULT_FILTER VARCHAR(2000);
        DECLARE _QUERY VARCHAR(8000);
        
        SET @_DEFAULT_FILTER = CONCAT('(', _AUTHENTICATED_USER_ID, ' IN (SELECT ID_UTILIZATOR FROM UTILIZATORI_DREPTURI WHERE ID_DREPT IN (SELECT ID FROM DREPTURI WHERE UPPER(DENUMIRE)=''VIZUALIZARE'')) OR ', _AUTHENTICATED_USER_ID, ' IN (SELECT ID_UTILIZATOR FROM UTILIZATORI_DREPTURI WHERE ID_DREPT IN (SELECT ID FROM DREPTURI WHERE UPPER(DENUMIRE)=''ADMINISTRARE''))) AND ');

        -- ADMINI
        SET @_DEFAULT_FILTER = CONCAT('(', _AUTHENTICATED_USER_ID, ' IN (SELECT ID FROM UTILIZATORI WHERE ID_TIP_UTILIZATOR = (SELECT ID FROM TIP_UTILIZATORI WHERE UPPER(DENUMIRE)=''ADMINISTRATOR'')) OR ');

        -- SUPER USERS
        SET @_DEFAULT_FILTER = CONCAT(@_DEFAULT_FILTER, '(', _AUTHENTICATED_USER_ID, ' IN (SELECT ID FROM UTILIZATORI WHERE ID_TIP_UTILIZATOR = (SELECT ID FROM TIP_UTILIZATORI WHERE UPPER(DENUMIRE) LIKE ''%SUPER%'')) AND
                (D.ID_SOCIETATE_CASCO IN (SELECT ID_SOCIETATE FROM UTILIZATORI_SOCIETATI WHERE ID_UTILIZATOR=', _AUTHENTICATED_USER_ID, ') OR (DS.VIZA_CASCO = TRUE AND D.ID_SOCIETATE_RCA IN (SELECT ID_SOCIETATE FROM UTILIZATORI_SOCIETATI WHERE ID_UTILIZATOR=', _AUTHENTICATED_USER_ID, '))) ) OR ');

        -- REGULAR USERS
        SET @_DEFAULT_FILTER = CONCAT(@_DEFAULT_FILTER, '(', _AUTHENTICATED_USER_ID, ' IN (SELECT ID FROM UTILIZATORI WHERE ID_TIP_UTILIZATOR = (SELECT ID FROM TIP_UTILIZATORI WHERE UPPER(DENUMIRE) LIKE ''%REGULAR%'')) AND
                ((D.ID_SOCIETATE_CASCO IN (SELECT ID_SOCIETATE FROM UTILIZATORI_SOCIETATI WHERE ID_UTILIZATOR=', _AUTHENTICATED_USER_ID, ') AND D.ID_SOCIETATE_RCA IN (SELECT ID_SOCIETATE FROM UTILIZATORI_SOCIETATI_ADMINISTRATE WHERE ID_UTILIZATOR=', _AUTHENTICATED_USER_ID, ')) OR
                ((D.ID_SOCIETATE_RCA IN (SELECT ID_SOCIETATE FROM UTILIZATORI_SOCIETATI WHERE ID_UTILIZATOR=', _AUTHENTICATED_USER_ID, ') AND DS.VIZA_CASCO = TRUE) AND D.ID_SOCIETATE_CASCO IN (SELECT ID_SOCIETATE FROM UTILIZATORI_SOCIETATI_ADMINISTRATE WHERE ID_UTILIZATOR=', _AUTHENTICATED_USER_ID, ')) )) )');


        SET @_QUERY = CONCAT('SELECT DS.* FROM DOCUMENTE_SCANATE DS INNER JOIN DOSARE D ON DS.ID_DOSAR=D.ID WHERE DS.ID_DOSAR = ', _ID_DOSAR, ' AND (', @_DEFAULT_FILTER, ')');

        -- select @_QUERY;

          PREPARE stmt1 FROM @_QUERY;
          EXECUTE stmt1;
          DEALLOCATE PREPARE stmt1;
END $$
/*!50003 SET SESSION SQL_MODE=@TEMP_SQL_MODE */  $$

DELIMITER ;

