        _AUTHENTICATED_USER_ID INT,
        _ID_DOSAR INT)
BEGIN
        SELECT ID_UTILIZATOR FROM UTILIZATORI_SOCIETATI WHERE ID_SOCIETATE IN (SELECT ID_SOCIETATE_CASCO FROM DOSARE WHERE ID = _ID_DOSAR) OR ID_SOCIETATE IN (SELECT ID_SOCIETATE_RCA FROM DOSARE WHERE ID = _ID_DOSAR)
        UNION
        -- pentru SCA:
        SELECT ID_UTILIZATOR FROM UTILIZATORI_DOSARE WHERE ID_DOSAR = _ID_DOSAR AND ID_UTILIZATOR NOT IN (SELECT ID_UTILIZATOR FROM UTILIZATORI_SOCIETATI WHERE ID_SOCIETATE IN (SELECT ID_SOCIETATE_CASCO FROM DOSARE WHERE ID = _ID_DOSAR) OR ID_SOCIETATE IN (SELECT ID_SOCIETATE_RCA FROM DOSARE WHERE ID = _ID_DOSAR));
END $$
