DELIMITER $$

/*!50003 SET @TEMP_SQL_MODE=@@SQL_MODE, SQL_MODE='STRICT_TRANS_TABLES,NO_AUTO_CREATE_USER,NO_ENGINE_SUBSTITUTION' */ $$
CREATE DEFINER=`root`@`localhost` PROCEDURE `DOSAREsp_update`(
        _AUTHENTICATED_USER_ID INT,
        _ID INT,
        _NR_SCA VARCHAR(100),
        _DATA_SCA DATETIME,
        _ID_ASIGURAT_CASCO INT,
        -- _ASIGURAT_CASCO varchar(250),
        _NR_POLITA_CASCO VARCHAR(100),
        _ID_AUTO_CASCO INT,
        -- _NR_AUTO_CASCO VARCHAR(10),
        _ID_SOCIETATE_CASCO INT,
        _NR_POLITA_RCA VARCHAR(100),
        _ID_AUTO_RCA INT,
        -- _NR_AUTO_RCA VARCHAR(10),
        _VALOARE_DAUNA DOUBLE,
        _VALOARE_REGRES DOUBLE,
        _ID_INTERVENIENT INT,
        -- _INTERVENIENT VARCHAR(250),
        _NR_DOSAR_CASCO VARCHAR(100),
        _VMD DOUBLE,
        _OBSERVATII TEXT,
        _ID_SOCIETATE_RCA INT,
        _DATA_EVENIMENT DATETIME,
        _REZERVA_DAUNA DOUBLE,
        _DATA_INTRARE_RCA DATETIME,
        _DATA_IESIRE_CASCO DATETIME,
        _NR_INTRARE_RCA VARCHAR(100),
        _NR_IESIRE_CASCO VARCHAR(100),
        _ID_ASIGURAT_RCA INT,
        -- _ASIGURAT_RCA VARCHAR(250),
        _ID_TIP_DOSAR INT,
        _SUMA_IBNR DOUBLE,
        _DATA_AVIZARE DATETIME,
        _DATA_NOTIFICARE DATETIME
    )
BEGIN
        DECLARE _ID_ASIGURAT_CASCO_N, _ID_ASIGURAT_RCA_N, _ID_AUTO_RCA_N, _ID_AUTO_CASCO_N, _ID_INTERVENIENT_N INT;

        /*
        SET _ID_ASIGURAT_CASCO_N = _ID_ASIGURAT_CASCO;
        IF _ID_ASIGURAT_CASCO IS NULL OR _ID_ASIGURAT_CASCO=0 OR _ID_ASIGURAT_CASCO='' THEN
                IF _ASIGURAT_CASCO IS NOT NULL AND _ASIGURAT_CASCO!='' THEN
                        BEGIN
                        CALL ASIGURATIsp_insert(_ASIGURAT_CASCO, NULL, @_ID);
                        SET _ID_ASIGURAT_CASCO_N = @_ID;
                        END;
                END IF;
        END IF;


        SET _ID_ASIGURAT_RCA_N = _ID_ASIGURAT_RCA;
        IF _ID_ASIGURAT_RCA IS NULL OR _ID_ASIGURAT_RCA=0 OR _ID_ASIGURAT_RCA='' THEN
                IF _ASIGURAT_CASCO IS NOT NULL AND _ASIGURAT_CASCO!='' THEN
                        BEGIN
                        CALL ASIGURATIsp_insert(_ASIGURAT_RCA, NULL, @_ID);
                        SET _ID_ASIGURAT_RCA_N = @_ID;
                        END;
                END IF;
        END IF;


        SET _ID_INTERVENIENT_N = _ID_INTERVENIENT;
        IF _ID_INTERVENIENT IS NULL OR _ID_ASIGURAT_RCA=0 OR _ID_ASIGURAT_RCA='' THEN
                IF _INTERVENIENT IS NOT NULL AND _INTERVENIENT!='' THEN
                        BEGIN
                        CALL INTERVENIENTIsp_insert(_INTERVENIENT, NULL, @_ID);
                        SET _ID_INTERVENIENT_N = @_ID;
                        END;
                END IF;
        END IF;


        SET _ID_AUTO_RCA_N = _ID_AUTO_RCA;
        IF _ID_AUTO_RCA IS NULL OR _ID_AUTO_RCA=0 OR _ID_AUTO_RCA='' THEN
                IF _NR_AUTO_RCA IS NOT NULL AND _NR_AUTO_RCA!='' THEN
                        BEGIN
                        CALL AUTOsp_insert(_NR_AUTO_RCA, NULL, NULL, NULL, NULL, @_ID);
                        SET _ID_AUTO_RCA_N = @_ID;
                        END;
                END IF;
        END IF;


        SET _ID_AUTO_CASCO_N = _ID_AUTO_CASCO;
        IF _ID_AUTO_CASCO IS NULL OR _ID_AUTO_CASCO=0 OR _ID_AUTO_CASCO='' THEN
                IF _NR_AUTO_CASCO IS NOT NULL AND _NR_AUTO_CASCO!='' THEN
                        BEGIN
                        CALL AUTOsp_insert(_NR_AUTO_CASCO, NULL, NULL, NULL, NULL, @_ID);
                        SET _ID_AUTO_CASCO_N = @_ID;
                        END;
                END IF;
        END IF;
        */

        UPDATE DOSARE SET
        NR_SCA =_NR_SCA,
        DATA_SCA = _DATA_SCA,
        -- ID_ASIGURAT_CASCO = _ID_ASIGURAT_CASCO_N,
        ID_ASIGURAT_CASCO = _ID_ASIGURAT_CASCO,
        NR_POLITA_CASCO = _NR_POLITA_CASCO,
        -- ID_AUTO_CASCO = _ID_AUTO_CASCO_N,
        ID_AUTO_CASCO = _ID_AUTO_CASCO,
        ID_SOCIETATE_CASCO = _ID_SOCIETATE_CASCO,
        NR_POLITA_RCA = _NR_POLITA_RCA,
        -- ID_AUTO_RCA = _ID_AUTO_RCA_N,
        ID_AUTO_RCA = _ID_AUTO_RCA,
        VALOARE_DAUNA = _VALOARE_DAUNA,
        VALOARE_REGRES = _VALOARE_REGRES,
        -- ID_INTERVENIENT = _ID_INTERVENIENT_N,
        ID_INTERVENIENT = _ID_INTERVENIENT,
        NR_DOSAR_CASCO = _NR_DOSAR_CASCO,
        VMD = _VMD,
        OBSERVATII = _OBSERVATII,
        ID_SOCIETATE_RCA = _ID_SOCIETATE_RCA,
        DATA_EVENIMENT = _DATA_EVENIMENT,
        REZERVA_DAUNA = _REZERVA_DAUNA,
        DATA_INTRARE_RCA = _DATA_INTRARE_RCA,
        DATA_IESIRE_CASCO = _DATA_IESIRE_CASCO,
        NR_INTRARE_RCA = _NR_INTRARE_RCA,
        NR_IESIRE_CASCO = _NR_IESIRE_CASCO,
        -- ID_ASIGURAT_RCA = _ID_ASIGURAT_RCA_N,
        ID_ASIGURAT_RCA = _ID_ASIGURAT_RCA,
        ID_TIP_DOSAR = _ID_TIP_DOSAR,
        SUMA_IBNR = _SUMA_IBNR,
        DATA_AVIZARE = _DATA_AVIZARE,
        DATA_NOTIFICARE = _DATA_NOTIFICARE
        WHERE ID = _ID;

END $$
/*!50003 SET SESSION SQL_MODE=@TEMP_SQL_MODE */  $$

