        _AUTHENTICATED_USER_ID INT,
        _NR_AZT VARCHAR(250),
        _AUTO_AZT VARCHAR(250),
        _POLITA_AZT VARCHAR(250)
    )
BEGIN
        DECLARE _VAL VARCHAR(250);
        SET _VAL = (SELECT NR_AZT FROM DOSARE WHERE NR_AZT = _NR_AZT);
        IF _VAL IS NULL THEN
                BEGIN
                SET _VAL = (SELECT NR_AZT FROM DOSARE WHERE POLITA_AZT = _POLITA_AZT);
