        _AUTHENTICATED_USER_ID INT,
        _ID INT,
        _ID_DOSAR INT,
        _ID_DOSAR_STADIU INT,
        _ID_SENTINTA INT,
        _ID_SOLUTIE INT
    )
BEGIN
        DELETE FROM DOSARE_STADII_SENTINTE WHERE ID_DOSAR_STADIU = _ID_DOSAR_STADIU AND ID_SENTINTA=_ID_SENTINTA;
