        DELETE FROM DOSARE_STADII WHERE ID=_ID_DOSAR_STADIU;
        UPDATE TEMP_TO_IMPORT SET ID_DOSAR_STADIU=NULL, ID_SENTINTA=NULL, ID_SOLUTIE=NULL WHERE ID=_ID;

        CALL DOSAREsp_UpdateCalculAll(_ID_DOSAR);
END $$
