    )
BEGIN
        SELECT U.*, R2.ID_DOSAR FROM
        (SELECT RU.* FROM DOSARE R
                INNER JOIN DOSARE_UTILIZATORI RU ON R.ID = RU.ID_DOSAR
                WHERE R.ID = _ID_DOSAR) R2
        RIGHT JOIN UTILIZATORI U ON R2.ID_DOCUMENT = U.ID
