        _AUTHENTICATED_USER_ID INT,
        _ID_DOSAR INT,
        _ID_UTILIZATOR INT
    )
BEGIN
        DECLARE _CNT INT;
        SET _CNT = (SELECT COUNT(*) CNT FROM UTILIZATORI_DREPTURI UD INNER JOIN DREPTURI DR ON UD.ID_DREPT = DR.ID WHERE LOWER(DR.DENUMIRE)='administrare' AND UD.ID_UTILIZATOR = _ID_UTILIZATOR);
        IF _CNT IS NULL OR _CNT <= 0 THEN
                SET _CNT = (SELECT COUNT(*) CNT FROM UTILIZATORI_DOSARE WHERE ID_DOSAR = _ID_DOSAR AND ID_UTILIZATOR = _ID_UTILIZATOR);
        END IF;
        SELECT _CNT;
END $$
