DECLARE _CHELTUIELI_MICA_PUBLICITATE DOUBLE;
DECLARE _ONORARIU_CURATOR DOUBLE;
DECLARE _ALTE_CHELTUIELI_JUDECATA DOUBLE;
DECLARE _TAXA_TIMBRU_REEXAMINARE DOUBLE;
