DROP PROCEDURE IF EXISTS `LOGINsp`;

DELIMITER $$

/*!50003 SET @TEMP_SQL_MODE=@@SQL_MODE, SQL_MODE='STRICT_TRANS_TABLES,NO_AUTO_CREATE_USER,NO_ENGINE_SUBSTITUTION' */ $$
CREATE DEFINER=`root`@`localhost` PROCEDURE `LOGINsp`(
        _AUTHENTICATED_USER_ID INT,
        _username VARCHAR(250),
        _password VARCHAR(250),
        _ip VARCHAR(250)
    )
BEGIN
        SELECT U.*, S.ID ID_SOCIETATE, S.DENUMIRE SOCIETATE FROM UTILIZATORI U
        LEFT JOIN UTILIZATORI_SOCIETATI US ON U.ID=US.ID_UTILIZATOR
        LEFT JOIN SOCIETATI_ASIGURARE S ON US.ID_SOCIETATE=S.ID
        WHERE USER_NAME = _username AND PASSWORD = _password AND (IP = _ip OR _ip IS NULL);
END $$
