create table `tmp_reg` (id_regres int, id int) SELECT RS.* FROM DOSARE_STADII RS INNER JOIN (SELECT ID_DOSAR, MAX(ID) ID FROM DOSARE_STADII GROUP BY ID_DOSAR) RS2 ON RS.ID_DOSAR = RS2.ID_DOSAR AND RS.ID = RS2.ID; 
