create table `tmp_conc` (id_regres int, data datetime) SELECT ID_DOSAR, MAX(DATA) DATA FROM DOSARE_STADII RS WHERE ID_STADIU = (SELECT ID FROM STADII WHERE UPPER(DENUMIRE)='CONCILIERE') GROUP BY ID_DOSAR; 
