create table `tmp_trm` (id_regres int, termen datetime) SELECT ID_DOSAR, MAX(TERMEN) TERMEN FROM DOSARE_STADII RS WHERE ID_STADIU IN (SELECT ID FROM STADII WHERE STADIU_INSTANTA=TRUE) GROUP BY ID_DOSAR; 
