--
-- Definition of procedure `UTILIZATORIsp_CountUnreadMessages`
--

DROP PROCEDURE IF EXISTS `UTILIZATORIsp_CountUnreadMessages`;

DELIMITER $$

/*!50003 SET @TEMP_SQL_MODE=@@SQL_MODE, SQL_MODE='STRICT_TRANS_TABLES,NO_AUTO_CREATE_USER,NO_ENGINE_SUBSTITUTION' */ $$
CREATE DEFINER=`root`@`localhost` PROCEDURE `UTILIZATORIsp_CountUnreadMessages`(
        _AUTHENTICATED_USER_ID INT,
        _ID_UTILIZATOR INT)
BEGIN
        SELECT TM.DENUMIRE, M.ID_TIP_MESAJ, COUNT(*) MESAJE_NOI FROM MESAJE_UTILIZATORI MU
        INNER JOIN MESAJE M ON MU.ID_MESAJ = M.ID
        INNER JOIN UTILIZATORI U ON MU.ID_UTILIZATOR = U.ID
        INNER JOIN TIP_MESAJE TM ON M.ID_TIP_MESAJ = TM.ID
        WHERE ID_UTILIZATOR = _ID_UTILIZATOR AND (M.DATA >= U.LAST_REFRESH OR U.LAST_REFRESH IS NULL)
        GROUP BY M.ID_TIP_MESAJ;
END $$
/*!50003 SET SESSION SQL_MODE=@TEMP_SQL_MODE */  $$

DELIMITER ;

