        SELECT * FROM UTILIZATORI_SOCIETATI WHERE ID_SOCIETATE IN (SELECT ID_SOCIETATE_CASCO FROM DOSARE WHERE ID = _ID_DOSAR) AND ID_UTILIZATOR != _ID_SENDER
        UNION
        SELECT * FROM UTILIZATORI_SOCIETATI WHERE ID_SOCIETATE IN (SELECT ID_SOCIETATE_RCA FROM DOSARE WHERE ID = _ID_DOSAR);
END $$
/*!50003 SET SESSION SQL_MODE=@TEMP_SQL_MODE */  $$

