--
-- Definition of procedure `UTILIZATORI_SETARIsp_GetValue`
--

DROP PROCEDURE IF EXISTS `UTILIZATORI_SETARIsp_GetValue`;

DELIMITER $$

/*!50003 SET @TEMP_SQL_MODE=@@SQL_MODE, SQL_MODE='STRICT_TRANS_TABLES,NO_AUTO_CREATE_USER,NO_ENGINE_SUBSTITUTION' */ $$
CREATE DEFINER=`root`@`localhost` PROCEDURE `UTILIZATORI_SETARIsp_GetValue`(
        _AUTHENTICATED_USER_ID INT,
        _ID_UTILIZATOR INT,
        NUME_SETARE VARCHAR(250)
    )
BEGIN
        DECLARE _VALOARE VARCHAR(100);
        SET _VALOARE = (
                SELECT US.VALOARE FROM UTILIZATORI_SETARI US INNER JOIN SETARI S ON US.ID_SETARE=S.ID WHERE US.ID_UTILIZATOR = _ID_UTILIZATOR AND UCASE(S.NUME) = UCASE(NUME_SETARE) LIMIT 1
            );
        IF _VALOARE IS NULL OR _VALOARE = '' THEN
